import { useEffect, useState } from 'react';
import { getImage } from '../utils/imageService';
import { urlFor } from '../utils/imageUrl';

const Images = () => {
  const [bilder, setBilder] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  console.log(bilder);

  useEffect(() => {
    const fetchDataAsync = async () => {
      setLoading(true);
      try {
        const data = await getImage();
        setBilder(data);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };
    fetchDataAsync();
  }, []);

  return (
    <section>
        {loading? <p>Bilder lastes..</p> : null}
         {error? <p>Noe har skjedd: {error}</p> : null}
          {bilder?.length > 0 &&
          bilder.map((images, index) => (
              <div>
              <img key={index} src={urlFor(images?.raw?.image).width(700).format('webp').url()} alt={images.alt}/>
              <figcaption>{images.bildetekst}</figcaption>
              </div>
          ))}
    </section>
  )
};
export default Images;
